import { Container, Content, Presentation, Pictures } from "./styles";


const profile =  require("../../assets/perfil.jpg")

const SF1 = require("../../assets/SF1.JPG")
const SF2 = require("../../assets/SF2.JPG")
const SF3 = require("../../assets/SF3.JPG")

const SK1 = require("../../assets/SK1.JPG")
const SK2 = require("../../assets/SK2.jpg")
const SK3 = require("../../assets/SK3.JPG")

const BG1 = require("../../assets/background1.jpg")
const BG2 = require("../../assets/background2.jpg")

const TP1 = require("../../assets/TP1.jpg")
const TP2 = require("../../assets/TP2.jpg")

const purple = require("../../assets/purple.png")

export function About(){
    return(
        <Container>
            <h1>meet me!</h1>
            <Content>
                <Pictures>
                    <img src={profile} alt="profile picture" id="profile"/>

                    <img src={SF1} alt="palace of fine arts" id="SF1"/>
                    <img src={SF2} alt="golden gate" id="SF2"/>
                    <img src={SF3} alt="maria and golden gate" id="SF3"/>

                    <img src={SK1} alt="Gyeongbokgung palace" id="SK1"/>
                    <img src={SK2} alt="jeju island" id="SK2"/>
                    <img src={SK3} alt="maria at lotte world" id="SK3"/>

                    <img src={BG1} alt="samsung museum" id="BG1"/>
                    <img src={BG2} alt="coex" id="BG2"/>

                    <img src={TP1} alt="jiunfen" id="TP1"/>
                    <img src={TP2} alt="maria at jiunfen" id="TP2"/>

                    <img src={purple} alt="filling" className="filling" id="FL1"/>
                    <img src={purple} alt="filling" className="filling" id="FL2"/>
                    <img src={purple} alt="filling" className="filling" id="FL1"/>
                    <img src={purple} alt="filling" className="filling" id="FL3"/>
                    <img src={purple} alt="filling" className="filling" id="FL1"/>
                    <img src={purple} alt="filling" className="filling" id="FL4"/>
                </Pictures>

                <Presentation>
                    <h2 id="title">Hello, world!</h2>
                    <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor 
                        incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud 
                        exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure
                         dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. 
                         Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt 
                         mollit anim id est laborum.</p>

                </Presentation>
            </Content>
        </Container>
    )
}
